import React from 'react'
import {NavLink} from 'react-router-dom'
import './navbar.css'

const Navbar = () => {
  return (
    <div><ul>
    <li><NavLink to='/' className="onclick active" >Home</NavLink></li>
    <li><NavLink to='/addscenario' className="onclick" >AddScenario</NavLink></li>
    <li><NavLink to='/addvehicle' className="onclick" >AddVehicle</NavLink></li>
    <li><NavLink to='/allscenarios' className="onclick" >AllScenarios</NavLink></li>
  </ul>
  
  </div>
  
  )
  
}
const activePage = window.location.pathname;
const navLinks = document.querySelectorAll('nav .onclick').forEach(link => {
  if(link.href.includes(`${activePage}`)){
    link.classList.add('active');
    console.log(link);
  }
})

export default Navbar
